import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Link } from 'react-router-dom';
import logo from '../img/logo.png';

function Menu() {

  const dropdownStyles = {
    color: '#81A649', // Color del texto
    backgroundColor: 'white', // Color de fondo
    // Otros estilos que desees aplicar
  };

  return (
    <Navbar expand="lg" className='p-3' bg="light" variant="light">
      <Navbar.Brand as={Link} to="/">
        <img
          src={logo}
          className="d-inline-block align-top"
          alt="Trasmundo Logo"
        />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto d-lg-flex">
          <Nav.Link as={Link} to="/" style={{ color: '#81A649' }}>Inicio</Nav.Link>
          <Nav.Link as={Link} to="/about" style={{ color: '#81A649' }}>Sobre Nosotros</Nav.Link>
          <Nav.Link as={Link} to="/contact" style={{ color: '#81A649' }}>Contacto</Nav.Link>
          <NavDropdown title="Servicios" id="basic-nav-dropdown">
            <NavDropdown.Item href="#service1">Servicio 1</NavDropdown.Item>
            <NavDropdown.Item href="#service2">Servicio 2</NavDropdown.Item>
            <NavDropdown.Item href="#service3">Servicio 3</NavDropdown.Item>
            <NavDropdown.Item href="#service4">Servicio 4</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Menu;
